import './App.css';
import { get_users } from './graphql/queries';
import { useQuery } from '@apollo/client';
function App() {
  const data=useQuery(get_users)
  return (
    <div className="App">
      <h1>Users</h1>
      {data && data.get_users.map((x)=>{
        <div>
           <p>{x.nom}</p>
        </div>
      })}
    </div>
  );
}

export default App;
